import React from 'react';
import './Shelf.css'
import Facing from './Facing';
import Card from '../UI/Card';
const Shelf = (props) => {

  console.log(props);

  return (
    <div>
      <Card className='shelf'>
      <p>Shelf#:{props.shelfID}</p>

      {props.shelf&&props.shelf.map((facing,index) => (
        <Facing
          key={index}
          facing = {facing}
          facingID={index+1}
          percentage={facing.state}
        />
      ))}
      </Card>
    </div>
  );
};
export default Shelf;
